import neuLogo from '../../images/northeastern univ logo.png';
import { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux';
import { getUniById } from "../../redux/action";
import { useParams } from "react-router-dom";
const UniHeader = () => {
    const dispatch = useDispatch();
    const uniDetsById = useSelector(state => state.uniById)
    console.log("test",uniDetsById);
    const { uniId } = useParams()
    console.log("id",uniId)
    useEffect(() => {
        dispatch(getUniById(uniId))
    },[])
    return (
        <div className="headerParent">
            <div className="uniImg">
                <img src={neuLogo} alt="University Logo" />
            </div>
            <div className="uniDetails">
                <div className="uniName">
                    Northeastern University
                </div>
                <div className="uniLoc">
                    Boston, USA
                </div>
                <div className="uniDesc">
                    <div>
                        <span>Global Ranking   #391</span>
                    </div>
                    <div>
                        <span>Acceptance Rate   40%</span>
                    </div>
                </div>
            </div>
        </div>
    )
} 

export default UniHeader;
